let padZero l1 l2 = match (List.length l1 <= List.length l2) with
  |true -> (List.append (clone 0 (List.length l2 - List.length l1)) l1, l2)
  |false -> (l1, List.append (clone 0 (List.length l1 - List.length l2)) l2);;

let _ = padZero [9;9] [1;0;0;2]
let _ = padZero [1;0;0;2] [9;9] 



let rec removeZero l = match l with 
  |[] -> []
  |h::t -> match h with 
    |0 -> removeZero t
    |_ -> l;;

