let _ = removeZero [0;0;0;0]



let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = let b = fst x + snd x in
        	match a with
          	| (y,[]) -> ( (b/10), (b mod 10) :: [])
          	| (y, h::t) -> ( ((b+y)/10), ((b+y) mod 10) :: (h) :: t) in 
    let base = (0,[]) in
    let args = List.combine (List.rev (0::l1)) (List.rev (0::l2)) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero l1 l2))

let _ = bigAdd [2] [8];;
let _ = bigAdd [9;9] [1;0;0;2];;
let _ = bigAdd [9;9;9;9] [9;9;9];; 



let rec mulByDigit i l = 
  let rec helper sum c = match c with
    |x when x <= 0 -> []
    |1 -> sum
    |_ -> helper (bigAdd sum l) (c-1)
  in helper [] (i+1);;



let _ = mulByDigit 9 [9;9;9;9]



let bigMul l1 l2 = 
  let f a x = match a with 
    |(y,[]) -> (y + 1,mulByDigit x l2 )
    |(y,(h::t) -> ( y + 1, bigAdd (h::t) (mulByDigit y (l2 @ clone 0 y))) in
  let base = (0,[]) in
  let args = l2 in
  let (_, res) = List.fold_left f base args in
    res


