  | [] -> []
  | h::t -> (match h with | 0 -> removeZero t | _ -> l);;

let bigAdd l1 l2 =
  let add (l1,l2) =
    let f a x =
      let b = (fst x) + (snd x) in
      match a with
      | (y,[]) -> ((b / 10), [b mod 10])
      | (y,h::t) -> (((b + y) / 10), (((b + y) mod 10) :: h :: t)) in
    let base = (0, []) in
    let args = List.combine (List.rev (0 :: l1)) (List.rev (0 :: l2)) in
    let (_,res) = List.fold_left f base args in res in
  removeZero (add (padZero l1 l2));;

let rec clone x n =
  match n with | y when y <= 0 -> [] | _ -> x :: (clone x (n - 1));;

let rec mulByDigit i l =
  let rec helper sum c =
    match c with
    | x when x <= 0 -> []
    | 1 -> sum
    | _ -> helper (bigAdd sum l) (c - 1) in
  helper [] (i + 1);;

let bigMul l1 l2 =
  let f a x =
    match a with
    | (y,[]) -> ((y + 1), (mulByDigit x l2))
    | (y,h::t) ->
